import React from 'react';
import './Nav.css';
const Nav = () => {
  return (
    <div className='nav'>

        <div className="nav_contents">
        <img className='nav_logo' src="https://www.edigitalagency.com.au/wp-content/uploads/Netflix-logo-red-black-png.png" alt="NetflixLogo" />

<img className='nav_avatar' src="https://upload.wikimedia.org/wikipedia/commons/0/0b/Netflix-avatar.png" alt="" />

        </div>



        </div>
  )
}

export default Nav
